//如果目标图标已存在，是否覆盖
const overwrite = false;

const distPath = path.resolve(__dirname, distDir);
if (!fs.existsSync(distPath)) {
    fs.mkdirSync(distPath, { recursive: true });
}
const getContent = function (title, icon, distPath) {
    const baseIconPath = path.resolve(__dirname, './base/BaseIcon.jsx');
    const dirPath = path.resolve(distPath, '../');
    let relativePath = path.relative(dirPath, baseIconPath).replace(/\\/g, '/');
    relativePath = relativePath.endsWith('.jsx')
        ? relativePath.substring(0, relativePath.length - 4)
        : relativePath;
    return `
import BaseIcon from '${relativePath}';

/**
 * ${title}
 * @param {} props 
 * @returns 
 */
export default function (props) {
    return (
        <BaseIcon
            {...props}
            icon='${icon}'
        ></BaseIcon>
    );
}    
    `;
};

function code2Filename(code) {
    return code.substring(0, 1).toUpperCase() + code.substring(1) + '.jsx';
}

metadatas.forEach((metadata) => {
    const { code, title, icon } = metadata;
    if (icon) {
        const absPath = path.resolve(distPath, code2Filename(code));
        if (!overwrite && fs.existsSync(absPath)) {
            throw Error('图标已存在，请处理！图标code:' + code);
        }
        const content = getContent(title, icon, absPath);
        fs.writeFileSync(absPath, content);
    }
});
